import React from 'react';
import dataPoke from './data'

class Pokemon extends React.Component {

  render() {

    const poke = this.propos.pokemon;

    return (

      poke.map((element) => (
        `Nome: ${element.name}`
        `Tipo: ${element.type}`
        `Peso médio: ${element.averageWeight}`
        `Foto: ${element.image}`
      ))

    )
  }
}

export default Pokemon;
